import { createStore, applyMiddleware, compose } from 'redux';
import thunk from 'redux-thunk';
import index from './reducers';
import {products} from './products';
const initialState = {
    product: products
};

const middleware = [thunk];
const store = createStore(index, initialState, compose(applyMiddleware(...middleware), window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__()));

export default store;
